void draw_screen(int);
void draw_row(int, int);
void set_latches(int);
void cycle(void);
void set_color(int, int, int);

int frame_counter = 0;
int div = 256/color_resolution;

int main(void)
{
	DDRC = 0xFF;
	DDRB = 0xFF;
	DDRD = 0xFF;

	sync = 0x00;
	color = 0x00;
	latch = 0x00;
	
	
	while (1)
	{
		
		for (int i = 0; i < color_resolution; i++)
		{
			frame_counter = i;
			draw_screen(0);
			//draw_screen(1);
		}
		
		
		//draw backwards
		for (int i = color_resolution-1; i >= 0; i--)
		{
			frame_counter = i;
			draw_screen(0);
		}
		
		/*
		for (int i = 0; i < 8; i++)
		{
		draw_screen(1);
		}
		*/
	}
}

void draw_screen(int frame){
	for (int i = 0; i < 32; i++)
	{
		set_latches(i);
		draw_row(frame, i);
		
		bit_set(sync, lat);
		//_delay_us(10);
		bit_clr(sync, lat);
	}
}

void set_latches(int row){

	/*
	for (int i = 0; i < 5; i++)
	{
	if (row & (1 << i))
	{
	latch |= (1 << i);
	}
	else{
	latch &= ~(1 << i);
	}
	}
	*/
	
	/*
	if (row == 0 || row == 31)
	{
	if (row == 31)
	{
	row = 0;
	}
	
	if (row == 0)
	{
	row = 31;
	}
	}
	*/
	if(row == 0)
	{
		row = 32;
	}
	
	
	if ((row-1)	& a){
		bit_set(latch, a);
	}
	else{
		bit_clr(latch, a);
	}
	
	if ((row-1)	& b){
		bit_set(latch, b);
	}
	else{
		bit_clr(latch, b);
	}
	
	if ((row-1)	& c){
		bit_set(latch, c);
	}
	else{
		bit_clr(latch, c);
	}
	
	if ((row-1)	& d){
		bit_set(latch, d);
	}
	else{
		bit_clr(latch, d);
	}
	
	if ((row-1) & e){
		bit_set(latch, e);
	}
	else{
		bit_clr(latch, e);
	}
}

void draw_row(int frame, int row){
	bit_set(sync, oe);
	bit_clr(sync, oe);
	
	for (int i = 0; i < 64; i++)
	{
		set_color(frame, row, i);
		cycle();
		
	}
	

}

void cycle(void){
	bit_set(sync, clk);
	//_delay_us(10);
	bit_clr(sync, clk);
}

void set_color(int frame, int row, int i){
	int comp = frame_counter*(div);
	
	if (frame == 0)
	{
		
		if (pgm_read_byte(&matrix_red[i + 64*row]) > comp)
		{
			bit_set(color, r1);
		}
		else{
			bit_clr(color, r1);
		}

		if (pgm_read_byte(&matrix_green[i + 64*row])> comp)
		{
			bit_set(color, g1);
		}
		else{
			bit_clr(color, g1);
		}

		if (pgm_read_byte(&matrix_blue[i + 64*row])> comp)
		{
			bit_set(color, b1);
		}
		else{
			bit_clr(color, b1);
		}
		
		if (pgm_read_byte(&matrix_red[i + 64*row+64*32])> comp)
		{
			bit_set(color, r2);
		}
		else{
			bit_clr(color, r2);
		}
		
		if (pgm_read_byte(&matrix_green[i + 64*row+64*32])> comp)
		{
			bit_set(color, g2);
		}
		else{
			bit_clr(color, g2);
		}
		
		if (pgm_read_byte(&matrix_blue[i + 64*row+64*32])> comp)
		{
			bit_set(color, b2);
		}
		else{
			bit_clr(color, b2);
		}
	}
	
	if (frame == 1)
	{
		
		if (pgm_read_byte(&matrix_red2[i + 64*row]))
		{
			bit_set(color, r1);
		}
		else{
			bit_clr(color, r1);
		}

		if (pgm_read_byte(&matrix_green2[i + 64*row]))
		{
			bit_set(color, g1);
		}
		else{
			bit_clr(color, g1);
		}

		if (pgm_read_byte(&matrix_blue2[i + 64*row]))
		{
			bit_set(color, b1);
		}
		else{
			bit_clr(color, b1);
		}
		
		if (pgm_read_byte(&matrix_red2[i + 64*row+64*32]))
		{
			bit_set(color, r2);
		}
		else{
			bit_clr(color, r2);
		}
		
		if (pgm_read_byte(&matrix_green2[i + 64*row+64*32]))
		{
			bit_set(color, g2);
		}
		else{
			bit_clr(color, g2);
		}
		
		if (pgm_read_byte(&matrix_blue2[i + 64*row+64*32]))
		{
			bit_set(color, b2);
		}
		else{
			bit_clr(color, b2);
		}
	}
}